import React from 'react';
import '../App.css';


const Homepage = (props) => {
    return (
        <div className="container-1">
            <div className="banner">
                <div className="">
                    <h1 style={{color:'white', fontSize:'50px', margin:'0px'}}>Res-happy</h1>
                    <h3>Let's get cooking!</h3>
                </div>
            </div>
            
        </div>
    );
}

export default Homepage;
